style.css:
@-moz-document
  
url-prefix("http://127.0.0.1:7860/"),
  url-prefix("http://127.0.0.1:7860/"),
  url-prefix("http://127.0.0.1:7860/"),
  url-prefix("http://127.0.0.1:7860/") {

  button.primary {
    background-image: #af2b2b;
    border-color: #af2b2b;
  }

  button.primary:focus,
  button.primary:hover {
    background-image: #991919;
    border-color: #991919;
  }

  .div.block.gradio-accordion {
    border-width: 3px !important;
    background: #1c232c;
  }

  #txt2img_prompt_container textarea {
    font-size: 18px;
    font-family: 'Open Sans', 'Source Sans Pro', 'ui-sans-serif', 'system-ui', Arial, sans-serif;
    line-height: 24px;
  }

  #txt2img_prompt_container #txt2img_neg_prompt textarea {
    font-size: 16px;
    line-height: 20px;
  }

  .gradio-row[id^="component-"] {
    margin-bottom: 12px;
  }

  .gr-group[id^="component-"] {
    margin-bottom: 20px;
  }

  .txt2img_script_container {
    margin-top: 12px;
    padding-top: 12px;
    border-top: 2px dashed #777777 !important;
  }

  .gradio-row[class*=" controlnet_"],
  .gradio-row[class*=" controlnet_"] .controlnet_control_mode_radio {
    margin-top: 20px !important;
  }

  .gradio-row.accordions>.gradio-accordion {
    background-image: #1f2937;
  }

}
